sys_variable_value.value:
(function execute(inputs, outputs) {
    // parse non-commented entries, create records in mid_profile_wrapper_config
    // GR for the settings
    var settingGr = new GlideRecord('mid_profile_wrapper_config');
    var profileGr = new GlideRecord('mid_server_profile');
    var lines = inputs.contents.split('\n');
    for (var i = 0; i < lines.length; i++) {
        if (lines[i].substr(0, 8) == 'wrapper.') {
            // valid setting found
            var setting = lines[i].split('=');
            var settingName = (setting[0].split('.'))[1];
          	gs.info("WRAPPER PARSE: found setting "+settingName+", "+setting[1]);
          	gs.info("WRAPPER PARSE: looking for profile "+inputs.midName);
            // check for an existing profile
            profileGr.addQuery('name', inputs.midName);
            profileGr.query();
            // create a profile if one doesn't exist
            if (!(profileGr.next())) {
              	gs.info("WRAPPER PARSE: profile "+inputs.midName+" not found, creating");
                profileGr.initialize();
                profileGr.name = inputs.midName;
                profileGr.insert();
            }
            // check if setting already exists
          	gs.info("WRAPPER PARSE: looking for setting "+settingName+" under profile "+profileGr.sys_id);
            settingGr.addQuery('name', settingName);
            settingGr.addQuery('profile', profileGr.sys_id);
            settingGr.query();
            // if exists, check value
            if (settingGr.next()) {
              	gs.info("WRAPPER PARSE: found existing setting "+settingName);
                if (settingGr.value != setting[1]) {
                    settingGr.value = setting[1];
                    settingGr.update();
                } 
            }
            else {
              	gs.info("WRAPPER PARSE: creating new setting "+settingName);
               	settingGr.initialize();
             	settingGr.profile = profileGr.sys_id;
                settingGr.name = settingName;
                settingGr.value = setting[1];
                settingGr.insert();
            }
        }
    }
})(inputs, outputs);

